uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User Parameters
uniform float u_speed;
uniform float u_fov;
uniform float u_camera_dist;
uniform float u_glow_intensity;

out vec4 fragColor;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum for organic blending
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// Path for the "Universe" to follow
vec2 getPath(float z) {
    return vec2(
        sin(z * 0.15) * 3.0 + cos(z * 0.08) * 2.0,
        cos(z * 0.12) * 2.5
    );
}

// Palette function for smooth gradients
vec3 getPalette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.0, 0.33, 0.67);
    return a + b * cos(6.28318 * (c * t + d));
}

// --- MAP / SDF ---
float map(vec3 p) {
    // 1. Center the universe around the path
    p.xy -= getPath(p.z);

    // 2. Twist and Repeat
    float z_rot = p.z * 0.1;
    p.xy *= rot(z_rot);

    // 3. Domain Repetition for "Infinity"
    vec3 q = p;
    float cell_z = 4.0;
    q.z = mod(q.z, cell_z) - cell_z * 0.5;

    // 4. Geometry: Recursive "Smooth" Rings and Bars
    float d = 1e10;

    // Central core
    float core = length(q.xy) - 0.2;

    // Rotating orbiters
    for(float i = 0.0; i < 3.0; i++) {
        vec3 p_i = q;
        float angle = i * 2.094 + iTime * 0.5;
        p_i.xy *= rot(angle);
        p_i.x -= 1.8 + sin(iTime + i * 1.5) * 0.5;

        float ring = length(p_i.xz) - 0.15;
        float bars = length(p_i.xy) - 0.05;

        d = smin(d, ring, 0.5);
        d = smin(d, bars, 0.4);
    }

    return smin(d, core, 0.8);
}

void main() {
    // Correct Aspect Ratio
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // 1. Setup Time and Motion
    float t = iTime * u_speed;

    // 2. Parallel Rail Camera System
    // Calculate path position
    vec3 pathPos = vec3(0.0, 0.0, t);
    pathPos.xy += getPath(pathPos.z);

    // Rail offset (Camera orbits the center path)
    float railRot = t * 0.1;
    vec2 railVec = vec2(cos(railRot), sin(railRot)) * u_camera_dist;

    // Position camera on the rail
    vec3 ro = pathPos;
    ro.xy += railVec;

    // Target is ahead on the rail, looking slightly inward
    vec3 ta = vec3(0.0, 0.0, t + 10.0);
    ta.xy += getPath(ta.z) + railVec * 0.7; 

    // Camera Matrix
    vec3 cw = normalize(ta - ro);
    vec3 cu = normalize(cross(cw, vec3(0.0, 1.0, 0.0)));
    vec3 cv = normalize(cross(cu, cw));
    vec3 rd = normalize(uv.x * cu + uv.y * cv + cw * u_fov);

    // 3. Raymarching Loop
    float dTotal = 0.0;
    float glow = 0.0;
    float dist = 0.0;
    vec3 col = vec3(0.0);

    for(int i = 0; i < 100; i++) {
        vec3 p = ro + rd * dTotal;
        dist = map(p);

        if(dist < 0.001 || dTotal > 60.0) break;

        // Accumulate smooth glow based on proximity
        glow += exp(-dist * 1.5) * u_glow_intensity;

        dTotal += dist * 0.7; // Relaxed step for smoother edges
    }

    // 4. Coloring & Shading
    vec3 sceneCol = getPalette(dTotal * 0.05 + iTime * 0.1);

    // Distance-based lighting / Fog
    float fog = 1.0 - exp(-dTotal * 0.04);
    vec3 fogCol = vec3(0.02, 0.01, 0.05); // Deep space background

    // Base surface color
    col = sceneCol * (1.0 - fog);

    // Add glowing volumetric light
    vec3 glowCol = getPalette(iTime * 0.2);
    col += glowCol * glow * 0.15;

    // Mix with background fog
    col = mix(col, fogCol, fog);

    // 5. Post Processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.2 - dot(uv, uv) * 0.5; // Subtle vignette

    fragColor = vec4(col, 1.0);
}
